import React, {useState, useEffect} from 'react';
import UploadBar from './UploadBar'
import ImageThumbnail from './ImageThumbnail'
import './css/Main.css'
import axios from 'axios'

function Main(props) {

    const [imageThumbnails, setImageThumbnails] = useState([]);

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = () => {
        console.log("AAAAAAAAAAAa");
        axios.get('http://localhost:5000/file/getImages')
        .then((res) => {
            let newThumbnails = [];
            res.data.map((el, i) => {
                newThumbnails.push(<ImageThumbnail id={el.id}/>);
            });
            setImageThumbnails([...imageThumbnails, ...newThumbnails]);
        });
    }

    return(
        <div className="row gy-4 main-grid mx-auto pt-3">
            {imageThumbnails}
        </div> 
    )
} 

export default Main;
